import "./App.css";
import axios from "axios";
import { useEffect, useState } from "react";
import SearchSection from "./SearchSection";

function App() {
  const [search, setSearch] = useState(true);
  const [addWords, setAddWords] = useState(false);
  const [wall, setWall] = useState(false);

  const post = () => {
    const blog = { "hi there": "hi" };
    fetch("http://namelist.herokuapp.com/namelist", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(blog),
    }).then(() => {
      console.log("new blog added");
    });
  };

  return (
    <div className="App">
      <div className="buttons">
        {search ? (
          <div>
            <button>Add words</button>
            <button>Wall of Fame</button>
            <SearchSection />
          </div>
        ) : null}
        {addWords ? (
          <div>
            <button>Your name</button>
            <button>Wall of Fame</button>
          </div>
        ) : null}
        {wall ? (
          <div>
            <button>Your name</button>
            <button>Add words</button>
          </div>
        ) : null}
      </div>

      <button onClick={() => post()}>here</button>
    </div>
  );
}

export default App;
